import React, { PureComponent } from 'react'
import { View, Text, StyleSheet, Image } from 'react-native'
import { ScrollView } from 'react-native-gesture-handler'
import ActiveElement from '../modules/ActiveElement'
import MainHeader from '../modules/MainHeader'
import Unions from '../modules/unions'
import { h, w } from '../modules/constants'


export default class ActiveScreen extends PureComponent {
    render(){
        const { container, text, main } = styles
        const { navigate } = this.props.navigation
        const unions = [['Insight', 'Социально-психологический центр «ИнсайТ»', '«ИнсайТ»', require('../assets/insight.jpg')], ['Ermak', 'Военно-патриотический клуб «Ермак»', '«Ермак»'], ['Souz', 'Союз студентов', 'Союз студентов', require('../assets/souz.jpg')], ['Otryad', 'Студенческие отряды', 'Студенческие отряды'],
                        ['Lis', 'Лига интеллектуального спорта «Лис»', '«Лис»'], ['International', 'Международный студенческий клуб', 'МСК'], ['Cybersport', 'Киберспортивная лига', 'КСЛ'],
                        ['Science', 'Студенческое научное общество', 'СНО'], ['Volunteer', 'Студенческий волонтерский ресурсный центр', 'Волонтерский центр'], ['Profkom', 'Первичная профсоюзная организация студентов', 'Профком'],
                        ['AeroSOSI', 'Медиа-группа аэроСМИ', 'аэроСМИ'], ['Sirius', 'Лига интеллектуальных игр «Сириус»', '«Сириус»', require('../assets/sirius.png')]]
        const data = Unions
        return(
            <View style={container}>
                <MainHeader title={'Мои объединения'} onPress={() => this.props.navigation.goBack()}/>
                <ScrollView>
                {/*<Text style={text}>Студенческие объединения</Text>*/}
                    <View style={main}>
                        {unions.map( item => {
                            return(<ActiveElement onPress={() => navigate('Ermak', {unions: item[2], data: data})} title={item[1]} source={item[3]} key={item[0]} />)
                        })}

                    </View>
                </ScrollView>
            </View>
        )
    }
}

const styles = StyleSheet.create({
    main: {
        paddingBottom: 30, 
        width: w,
    },

    text: {
        fontSize: 25,
        color: '#006AB3',
        fontFamily: 'roboto',
        marginTop: 10,
        marginLeft: 10,
    },
})
